import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from '../pages/Home';
import MainLayout from '../layouts/MainLayout';
import AuthLayout from '../layouts/AuthLayout';

// Import all your components
import InspectorDashboard from '../pages/Inspector/Dashboard';
import OwnerDashboard from '../pages/Owner/Dashboard';
// ... other imports ...

const AppRoutes = () => {
    return (
        <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />

            {/* Auth Routes */}
            <Route path="/auth" element={<AuthLayout />}>
                <Route path="login" element={<Login />} />
                <Route path="register" element={<Register />} />
            </Route>

            {/* Inspector Routes */}
            <Route path="/inspector" element={<MainLayout userType="inspector" />}>
                <Route path="dashboard" element={<InspectorDashboard />} />
                <Route path="scan-plate" element={<ScanPlate />} />
                <Route path="inspection-history" element={<InspectionHistory />} />
                <Route path="upload-report" element={<UploadReport />} />
            </Route>

            {/* Owner Routes */}
            <Route path="/owner" element={<MainLayout userType="owner" />}>
                <Route path="dashboard" element={<OwnerDashboard />} />
                <Route path="vehicle-details" element={<VehicleDetails />} />
                <Route path="book-appointment" element={<BookAppointment />} />
                <Route path="view-reports" element={<ViewReports />} />
            </Route>
        </Routes>
    );
};

export default AppRoutes;
